import React from "react";
import { connect } from "react-redux";
import boy from "./media/boy.png";
import girl from "./media/girl.png";
import man from "./media/man.png";
import lady from "./media/lady.png";
import { useNavigate } from "react-router-dom";

const Profile = ({ user }) => {
  const navigate = useNavigate();
  return (
    <div className="row">
      <div
        onClick={() => navigate(-1)}
        className="col offset-m1 offset-s1 back-i-p"
      >
        <i class="large back-icon">arrow_back</i>
      </div>
      <div className="col offset-m10 offset-s9 logout-p">
        <a class=" btn logout">Log out</a>
      </div>
      <div className="container">
        <div className="col m7 offset-m2 s12 prof1">
          <img src={require("./media/" + user.avatar + ".png")}></img>
        </div>
      </div>
    </div>
  );
};
const mapStateToProps = (state) => {
  return { user: state.users };
};

export default connect(mapStateToProps)(Profile);
